define(['shared/models/BaseModel'], function (BaseModel) {
  return BaseModel.extend({
    urlRoot: '/oauth2/v1/clients',
    props: {
      'id': 'string',
      'created': 'string',
      'lastUpdated': 'string',
      'client_name': ['string', true],
      'client_uri':  'string',
      'logo_uri': 'string',
      'redirect_uris': ['array', true, []],
      'response_types': ['array', true, []],
      'grant_types': ['array', true, []],
      'jwks_uri': 'string',
      'jwks': 'string',
      'token_endpoint_auth_method': 'string',
      'client_id': 'string',
      'client_secret': 'string',
      'client_id_issued_at': 'string',
      'client_secret_expires_at': 'string',
      'application_type' : {
        type: 'string',
        values: ['WEB', 'BROWSER', 'NATIVE'],
        required: true,
        value: 'WEB'
      },
      '__allow_offline_access__': 'boolean',
      '_links': 'object',
      '_links.newSecret.href': 'string',
      '_links.newSecret.hints.allow': 'string',
      '__step__': 'integer'
    }
  });
});
